import React from 'react';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle";
import Navbar from './components/Navbar';
import Home from './components/pages/Home';
import Inthewomb from './components/pages/Inthewomb';
import Pregnancybyweek from './components/pages/Pregnancybyweek';
import KickCounter from './components/pages/KickCounter';
import ContractionTimer from './components/pages/ContractionTimer';
import GrowthTracker from './components/pages/GrowthTracker';
import HospitalBagChecklist from './components/pages/HospitalBagChecklist';
import MyBabyName from './components/pages/MyBabyName';
import DailySelfcareChecklist from './components/pages/DailySelfcareChecklist';
import ArticleandVideo from './components/pages/ArticleandVideos';
import Insights from './components/pages/Insights';
import BabyProducts from './components/pages/BabyProducts';
import DoctorChanneling from './components/pages/DoctorChanneling';
import Calendar from './components/pages/Calendar';

import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Router>

      <div>
      <Navbar />
        <Routes>

          <Route exact path="/" element = {<Home />} />
          <Route exact path="/calendar" element = {<Calendar />} />
          <Route exact path="/" element = {<Pregnancybyweek />} />
          <Route exact path="/" element = {<Inthewomb />} />
          <Route exact path="/" element = {<KickCounter />} />
          <Route exact path="/" element = {<ContractionTimer />} />
          <Route exact path="/" element = {<GrowthTracker />} />
          <Route exact path="/" element = {<HospitalBagChecklist />} />
          <Route exact path="/" element = {<MyBabyName />} />
          <Route exact path="/" element = {<ArticleandVideo />} />
          <Route exact path="/" element = {<Insights />} />
          <Route exact path="/" element = {<DailySelfcareChecklist />} />
          <Route exact path="/" element = {<BabyProducts />} />
          <Route exact path="/" element = {<DoctorChanneling />} />
          <Route exact path="/" element = {<DailySelfcareChecklist />} />
          <Route exact path="/" element = {<DailySelfcareChecklist />} />



        </Routes>
        </div>
    </Router>
  );
}

export default App;
